#Creating a subfunctions for getting the next state and actions...

def get_next_state(mdp, s, a):
  next_s = ' '
  dic = mdp.get_next_states(s, a)
  for key, value in dic.items():
    next_s = key
  return next_s

def get_action(mdp):
  list2 = list(mdp.get_possible_actions('s1'))
  return random.choice(list2)

#Creating a function for Policy Evaluation...

def one_policy_evaluation(mdp, gamma, V):
  delta = 0
  for s in mdp.get_all_states():
    temp = V[s]
    a = get_action(mdp)
    next_s = get_next_state(mdp, s, a)  #our next state in our current MDP will be only one state per action.
    p = mdp.get_transition_prob(next_s, a, s)
    # p = 0.5
    reward = mdp.get_reward(next_s, a, s)
    # reward = 0.1
    V[s] = reward + gamma * np.sum(p * V[s])
    delta = max(delta, abs(temp - V[s]))
  return delta, V

#Creating a function for Policy Evaluation...
def policy_evaluation(mdp, gamma, V, tol):
  
  epoch = 0
  delta, V = one_policy_evaluation(mdp, gamma, V)
  #delta_history = [delta]
  converge = False
  
  while converge == True | epoch < 500:
    delta, V = one_policy_evaluation(mdp, gamma, V)
    #delta_history.append(delta)
    if delta < tol:
      converge = True
  
  return V

