#Creating a function for Policy Improvement as well...

def policy_improvement(mdp,V):
  update_policy_count = 0
  change = False

  for s in mdp.get_all_states():
    temp = V[s]
    
    v_list = [0.,0.,0.,0.]  #Values for the optimal policy...
    for a in range(4):
      # A = mdp.get_possible_actions(s)
      act = get_action(mdp)  #To initialize the policy randomly, we select a random action to be updated.
      next_s = get_next_state(mdp, s, act)  #our next state in our current MDP will be only one state per action.
      p = mdp.get_transition_prob(next_s, act, s)
      v_list[a] = np.sum(p * V[s])

    V[s] = np.argmax(v_list)
    if temp != V[s]:
      update_policy_count += 1
      change = True

  return update_policy_count, v_list

