#Creating a function for Policy Iteration...
def policy_iteration(mdp, V, tol, gamma):
  epoch = 0
  eval_count = policy_evaluation(mdp, gamma, V, tol)
  eval_count_history = [eval_count]
  policy_change = policy_improvement(mdp, V)
  policy_change_history = [policy_change]
  while epoch < 500:
    epoch += 1
    new_eval_count = policy_evaluation(mdp, gamma, V, tol)
    policy_counts, new_policy_change = policy_improvement(mdp, V)
    eval_count_history.append(new_eval_count)
    policy_change_history.append(policy_counts)
    # if policy_counts == 0:
    #   break

  return len(eval_count_history), new_policy_change, eval_count_history, policy_change_history

